import React, { Component } from 'react'
import WrapComponent from '@/components/wrapper'
import CampaignCard from './components/campaignCards'

class SelectCampaignType extends Component {
    render() {
        return (
            <WrapComponent>
                <CampaignCard />
            </WrapComponent>
        )
    }
}

export default SelectCampaignType
